  "text" : "\uC774\uAC8C \uC5B4\uB5A4 \uBD84\uB4E4\uC5D0\uAC8C\uB294 \uC880 \uAC70\uBD81\uD558\uAC8C \uBC1B\uC544\uB4E4\uC5EC\uC9C8 \uC218\uB3C4 \uC788\uB294\uB370, \uAD70\uBD80\uB300 \uB77C\uB294 \uAC83\uC774 \uC5B4\uB5BB\uAC8C \uBCF4\uBA74 \uC9D1\uB2E8\uC0DD\uD65C\uC758 \uCE21\uBA74\uC5D0\uC11C \uAD50\uC815\uC2DC\uC124\uACFC \uBE44\uC2B7\uD55C \uD658\uACBD\uC774\uAC70\uB4E0\uC694. \uADF8\uB7F0\uB370 \uAD50\uC815\uC2DC\uC124\uC5D0\uC11C\uC758 \uC131\uD589\uC704\uB294 \uCC98\uBC8C\uB300\uC0C1\uC774 \uC544\uB2CC \uC9D5\uACC4\uB300\uC0C1\uC785\uB2C8\uB2E4. \uC2EC\uC9C0\uC5B4\uB294 \uAD70\uAD50\uC815\uC2DC\uC124\uB3C4 \uD3EC\uD568\uD574\uC11C\uC694 @seungow",
