  "text" : "\uB3D9\uC131\uAC04\uC758 \uC131\uD589\uC704\uAC00 \uB418\uC5C8\uAC74, \uC774\uC131\uAC04\uC758 \uC131\uD589\uC704\uAC00 \uB418\uC5C8\uAC74\uAC04\uC5D0 \uC9D1\uB2E8\uAC70\uC8FC\uC0DD\uD65C\uC744 \uD558\uAC8C \uB418\uB294 \uAD70\uBD80\uB300 \uB0B4\uC5D0\uC11C\uC758 \uC131\uD589\uC704\uB294 \uD639\uC790\uB4E4\uC774 \uC774\uC57C\uAE30\uD558\uB294 \uAC83\uCC98\uB7FC \uADF8\uB807\uAC8C \uB9C9 \uD5C8\uC6A9\uD560 \uC218 \uC788\uB294 \uADF8\uB7F0 \uB0B4\uC6A9\uC774 \uC544\uB2C8\uC8E0. \uADF8\uAC78 \uD5C8\uC6A9\uD558\uB824\uBA74 \uBC00\uD3D0\uB41C \uC0AC\uC801 \uACF5\uAC04\uB3C4 \uB9CC\uB4E4\uB77C\uACE0 \uD574\uC918\uC57C\uC9C0. @seungow",
