  "text" : "\uC219\uC18C\uAC00 \uC8FC\uC5B4\uC9C0\uB294 \uAC04\uBD80\uAE09\uACFC\uB294 \uB2EC\uB9AC, \uC77C\uBC18 \uC0AC\uBCD1\uB4E4\uC758 \uACBD\uC6B0\uC5D0\uB294 \uAC08 \uC218 \uC788\uB294 \uC7A5\uC18C\uAC00 \uBED4\uD558\uC8E0. \uB300\uCCB4 \uC5B4\uB51C \uAC00\uC11C \uC131\uD589\uC704\uB97C \uD558\uACA0\uC2B5\uB2C8\uAE4C. \uC601\uB0B4\uC5D0 \uBAA8\uD154\uC774 \uC788\uB294 \uAC83\uB3C4 \uC544\uB2C8\uACE0.. (\uADF8\uB7EC\uACE0\uBCF4\uB2C8 \uB17C\uC0B0\uC721\uAD70\uD6C8\uB828\uC18C\uC5D0\uC11C\uB294 \uB204\uAC00 \uBA74\uD68C\uC628 \uC5EC\uCE5C\uACFC \uAC15\uB2F9\uC5D0\uC11C \uD558\uB2E4 \uAC78\uB838\uB2E4\uACE0) @seungow",
