  "id_str" : "327593672940077056",
  "text" : "'\uACE0\uC2DC'\uB77C \uD568\uC740 \uD589\uC815\uBD80\uC758 5\uAE09 \uD589\uC815\uC9C1\uAD70 \uBC0F \uAE30\uC220\uC9C1\uAD70 \uACF5\uBB34\uC6D0 \uB610\uB294 \uC678\uAD50\uD1B5\uC0C1\uC9C1 \uACF5\uBB34\uC6D0\uC744 \uC120\uBC1C\uD558\uAE30 \uC704\uD55C '\uACE0\uB4F1\uACE0\uC2DC'\uB97C \uB73B\uD558\uB294\uB370, \uADF8\uB7EC\uACE0\uBCF4\uB2C8 \uC5BC\uB9C8\uC804\uC5D0 \uACE0\uB4F1\uACE0\uC2DC\uB3C4 \uD3D0\uC9C0\uB418\uC5C8\uB124\uC694. \uB530\uB77C\uC11C \uC55E\uC73C\uB85C '\uD589\uC815\uACE0\uC2DC'\uC640 '\uC678\uBB34\uACE0\uC2DC'\uB3C4 \uC5C6\uC2B5\uB2C8\uB2E4. \uACE0\uC2DC \uC548\uB155-",
