  "id_str" : "327592682144804864",
  "text" : "\uB530\uB77C\uC11C \uC5C4\uBC00\uD788 \uB9D0\uD558\uC790\uBA74 '\uACE0\uC2DC\uC0DD'\uC758 \uBC94\uC8FC\uC5D0 \uC0AC\uBC95\uC2DC\uD5D8 \uC900\uBE44\uC0DD\uC740 \uD3EC\uD568\uB418\uC9C0 \uC54A\uC2B5\uB2C8\uB2E4. \uC0AC\uBC95\uC2DC\uD5D8\uC740 \uACE0\uC2DC\uAC00 \uC544\uB2C8\uAE30 \uB54C\uBB38\uC774\uC8E0. \uC77C\uBC18\uC801\uC73C\uB85C \uD1B5\uC6A9\uB418\uB294 \uBA85\uCE6D\uC774\uB2E4\uBCF4\uB2C8 \uADF8\uB0E5 \uADF8\uB7EC\uB824\uB2C8 \uD558\uACE0 \uC54C\uC544\uB4E3\uAE34 \uD558\uC9C0\uB9CC, \uC544\uBB34\uB9AC \uADF8\uB798\uB3C4 \uC5B8\uB860\uC5D0\uC120 \uC815\uD655\uD55C \uBA85\uCE6D\uC744 \uD45C\uAE30\uD560 \uD544\uC694\uAC00 \uC788\uC9C0\uC54A\uB098 \uC2F6\uACE0",
