  "text" : "\uCC38\uACE0\uB85C '\uC0AC\uBC95\uACE0\uC2DC'\uB780 \uC2DC\uD5D8\uC740 \uC5C6\uC2B5\uB2C8\uB2E4. '\uC0AC\uBC95\uC2DC\uD5D8'\uC774 \uC633\uC740 \uBA85\uCE6D\uC774\uC5D0\uC694. ('\uACE0\uC2DC'\uB77C \uD568\uC740 \uACE0\uB4F1\uACE0\uC2DC\uB97C \uB73B\uD558\uB294 \uB9D0\uC778\uB370, \uACFC\uAC70\uC5D0 \uACE0\uB4F1\uACE0\uC2DC\uB839\uC5D0 \uC758\uAC70\uD558\uC5EC \uACE0\uB4F1\uACE0\uC2DC \uC0AC\uBC95\uACFC\uAC00 \uC2DC\uD589\uB41C \uC801\uC774 \uC788\uC5C8\uACE0, \uC774\uAC83\uC774 \uC0AC\uBC95\uC2DC\uD5D8\uC73C\uB85C \uBCC0\uACBD\uB418\uC5B4 \uC9C0\uAE08\uAE4C\uC9C0 \uC774\uC5B4\uC624\uACE0 \uC788\uC9C0\uC694.)",
