  "text" : "\uAD70\uB300\uB77C\uB294 \uACF3\uC774 \uB2E4\uC218\uC758 \uC0AC\uB78C\uB4E4\uC774 \uD568\uAED8 \uC0DD\uD65C\uD558\uB294 \uD3D0\uC1C4\uB41C \uACF5\uAC04\uC774 \uB420 \uC218 \uBC16\uC5D0 \uC5C6\uB294\uB370, \uADF8\uB7F0 \uD658\uACBD\uC5D0\uC11C \uB3D9\uC131\uAC04\uC758 \uC131\uD589\uC704\uB97C \uD5C8\uC6A9\uD574 \uBC84\uB9B0\uB2E4\uBA74 \uADF8\uAC83\uB3C4 \uBB38\uC81C\uAC00 \uB418\uC9C0 \uC54A\uACA0\uC5B4\uC694? \uD589\uC704\uC790 \uBCF8\uC778\uB4E4\uC740 \uADF8\uB807\uB2E4\uCE58\uACE0, \uADF8\uAC78 \uD53C\uD558\uC9C0 \uBABB\uD558\uACE0 \uBCFC \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC740 \uC5B4\uCA54\uAEC0\uB370? @seungow",
