  "text" : "\uADFC\uB370 \uB9D0\uC774\uC8E0, \uB3D9\uC131\uAC04 \uC131\uD589\uC704\uB97C \uCC98\uBC8C\uD558\uACE0\uC790 \uD558\uB294 \uAD70\uD615\uBC95\uC758 \uCDE8\uC9C0\uB3C4 \uC77C\uC751 \uD0C0\uB2F9\uD55C \uBA74\uC774 \uC788\uC5B4\uC694. \uAD70\uB300 \uB0B4\uC758 \uB3D9\uC131\uC560\uB97C \uD5C8\uC6A9\uD558\uAC8C \uB418\uC5B4\uBC84\uB9AC\uBA74 \uAD70\uAE30\uAC15\uC774 \uBB34\uB108\uC9C0\uACE0, \uAC74\uC804\uD55C \uBCD1\uC601\uBB38\uD654 \uBC0F \uC870\uC9C1\uC0AC\uD68C\uAC00 \uC704\uD0DC\uD574\uC9C8 \uAC83\uC774\uB77C\uB294 \uD639\uC790\uB4E4\uC758 \uC8FC\uC7A5\uC5D0\uB3C4 \uD0C0\uB2F9\uC131\uC774 \uC788\uAD6C\uC694.",
