  "text" : "\uC5EC\uD2BC, \uB3D9\uC131\uC560 \uB17C\uB780\uC5D0 \uB300\uD574 \uC5B4\uB290 \uC21C\uAC04\uBD80\uD130 \uD540\uD2B8\uB97C \uC798\uBABB \uB9DE\uCD98 \uBD84\uB4E4\uC774 \uACC4\uC2DC\uAE38\uB798 \uADF8\uB0E5 \uD55C\uB9C8\uB514 \uD574\uBD24\uC74C. \uADF8 \uB204\uAD6C\uB3C4 \uD0C0\uC778\uC758 \uB0B4\uC2EC\uC758 \uC758\uC0AC\uC5D0 \uB300\uD574 \uAC04\uC12D\uD560 \uC218 \uC5C6\uB294\uAC81\uB2C8\uB2E4. \uADF8\uAC8C \uBC14\uB85C \uC591\uC2EC \uD615\uC131\uC758 \uC790\uC720\uB97C \uD3EC\uD568\uD558\uB294 \uD5CC\uBC95\uC0C1 '\uC591\uC2EC\uC758 \uC790\uC720'\uC5D0 \uB300\uD55C \uC874\uC911\uC774\uC8E0 @seungow",
