  "text" : "\uB09C \uADF8\uAC83 \uB54C\uBB38\uC5D0 \uC774\uAC83\uC800\uAC83- \uCEF4\uD4E8\uD130\uAE4C\uC9C0 \uAC08\uC544 \uC5CE\uACE0, \uAE30\uC874\uC5D0 \uC4F0\uB358 \uAC83\uB4E4\uC740 \uC804\uBD80 \uCC98\uBD84\uD588\uB294\uB370 \uB9D0\uC774\uC9C0. \uADF8\uB798\uC11C \uB0B4\uAC00 \uC9C0\uAE08 \uBD84\uB178\uAC00 \uD3ED\uBC1C\uD560 \uC218 \uBC16\uC5D0 \uC5C6\uC74C. \uC0C0\uB358\uAC74 \uC804\uBD80 \uC4F8\uBAA8\uAC00 \uC5C6\uC5B4\uC84C\uACE0, \uCC98\uBD84\uD55C \uAC83\uB4E4\uC740 \uB2E4\uC2DC \uC804\uBD80 \uC0C8\uB85C \uC0AC\uC57C\uB9CC \uD558\uB294 \uC0C1\uD669. \uC0AC\uB78C\uC744 \uAC00\uC9C0\uACE0 \uB178\uB124 \uC9C4\uC9DC..",
