  "text" : "\uC774 \uC0AC\uAC74 \uBC95\uB960\uC870\uD56D\uC740 \u2018\uC74C\uB780\u2019\uD55C \uC601\uC0C1 \uB4F1\uC744 \uC815\uBCF4\uD1B5\uC2E0\uB9DD\uC744 \uD1B5\uD558\uC5EC \uBC30\uD3EC\uD558\uB294 \uB4F1\uC758 \uD589\uC704\uB97C \uCC98\uBC8C\uD558\uACE0 \uC788\uC73C\uBBC0\uB85C, \uC704\uC640 \uAC19\uC740 \uC758\uC0AC\uD45C\uD604\uC758 \uB9E4\uAC1C\uCCB4\uC5D0 \uC758\uD55C \uC77C\uC815\uD55C \uB0B4\uC6A9\uC758 \uD45C\uD604\uC744 \uAE08\uC9C0\uD558\uACE0 \uC788\uB2E4\uB294 \uC810\uC5D0\uC11C \uD5CC\uBC95\uC0C1 \uBCF4\uC7A5\uB418\uACE0 \uC788\uB294 \uD45C\uD604\uC758 \uC790\uC720\uB97C \uC81C\uD55C\uD558\uB294 \uAC83\uC73C\uB85C @seungow",
