  "text" : "\uBC95\uC774\uB77C\uB294\uAC8C.. \uAD6C\uC131\uC694\uAC74\uC744 \uAE30\uC220\uC801 \uC694\uC18C\uB97C \uBAA8\uB450 \uADDC\uC815\uD558\uBA74 \uC88B\uACA0\uB2E4\uB9CC, \uC785\uBC95\uAE30\uC220\uC0C1 \uADF8\uAC83\uC740 \uBD88\uAC00\uB2A5\uC5D0 \uAC00\uAE4C\uC6C0. \uC608\uB97C \uB4E4\uC790\uBA74 \uC5C5\uBB34\uBC29\uD574\uC8C4\uC5D0\uC11C\uC758 \"\uC5C5\uBB34\"\uB97C \uD734\uB300\uD3F0\uD310\uB9E4, \uBD95\uC5B4\uBE75\uD310\uB9E4, \uC0DD\uC218\uD310\uB9E4, \uC138\uD0C1\uC18C\uC6B4\uC601 \uB4F1\uB4F1\uC73C\uB85C \uBAA8\uB450 \uAE30\uC220\uD558\uB294 \uAC83\uC774 \uAC00\uC7A5 \uC774\uC0C1\uC801\uC774\uACE0 \uB17C\uB780\uC758 \uC5EC\uC9C0\uAC00 \uC5C6\uC9C0\uB9CC",
