  "text" : "\uC5ED\uC2DC \uC2F8\uC6C0 \uAD6C\uACBD\uC740 \uC7AC\uBBF8\uC788\uB2E4. \uADF8\uB9AC\uACE0 \uAD6C\uACBD\uD558\uB2E4\uBCF4\uB2C8 \uB2E4\uB978 \uD55C \uC0AC\uB78C\uC5D0 \uB300\uD574\uC11C\uB294 \"\uBA85\uD655\uC131\uC758 \uC6D0\uCE59\uC774\uB77C\uB294 \uAC83\uC5D0 \uB300\uD574\uC11C\uB294 \uB4E4\uC5B4\uBCF8 \uBC14\uAC00 \uC788\uC73C\uB098, \uB514\uD14C\uC77C\uD55C \uC9C0\uC2DD\uAE4C\uC9C0\uB294 \uB4E4\uC5B4\uBCF4\uC9C0 \uBABB\uD55C \uC0AC\uB78C\"\uC774\uB77C\uB294 \uACB0\uB860\uC744 \uB0B4\uB9AC\uAC8C \uB418\uB294\uB370.. \uADF8\uB798\uB3C4 \uC800\uB807\uAC8C \uB05D\uAE4C\uC9C0 \uC6B0\uAE38 \uC218 \uC788\uC74C\uC5D0 \uAC74\uBC30(\uC751?)",
