  "text" : "\uD639\uC2DC \uC544\uB098.. \uBBF8\uB798\uC758 \uC9C4\uBCF4\uB294 \uC6B0\uC8FC\uC778\uACFC\uC758 \uC774\uC885\uD63C\uC744 \uC704\uD574 \uC2F8\uC6B0\uACE0, \uBBF8\uB798\uC758 \uBCF4\uC218\uB294 \uC774\uC5D0 \uB9DE\uC11C \uC774\uC131\uD63C\uACFC \uB3D9\uC131\uD63C\uC744 \uD3EC\uD568\uD558\uB294 \uB3D9\uC885\uD63C\uB9CC\uC774 \uC9C4\uB9AC\uB77C\uBA70 \uC2F8\uC6B0\uACE0 \uC788\uC744\uC9C0? \uADF8\uB9AC\uACE0 \uC6B0\uC8FC\uC778\uC774 \uC808\uB300\uC790\uB97C \uC548\uBBFF\uACE0, \uACBD\uC804\uC5D0\uB3C4 \uC548\uB098\uC628\uB2E4\uBA70 \uCC28\uBCC4\uD574\uC57C \uD55C\uB2E4\uB294 \uC885\uAD50\uC9D1\uB2E8\uC774 \uC788\uC744 \uC9C0\uB3C4 \uBAA8\uB974\uC9C0..",
