  "text" : "\uADFC\uB370 \uBB50, \uC5EC\uB860\uC758 \uD3ED\uC555\uC5D0 \uC758\uD574 \uC9C0X\uB808\uCF54\uB4DC\uAC00 \uD560 \uC218 \uC5C6\uC774 \uAE68\uAC31\uD558\uACE0 \uD1A0\uD574\uB0BC \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. \uBB38\uC81C\uB294 \uADF8\uAC83\uC774\uC57C\uB9D0\uB85C \uC9C4\uC9DC \"\uBE7C\uC557\uB294\" \uD589\uC704\uB77C\uB294\uAC70\uC8E0.\n\n\"\uC815\uB2F9\uD55C \uB0B4 \uAD8C\uB9B0\uB370!!! \uC5C9\uB6B1\uD55C \uB0A8\uB4E4\uC774 \uB5BC\uB85C \uBAB0\uB824\uC640\uC11C \uB0B4\uB193\uC73C\uB77C\uACE0 \uD611\uBC15\uD574!!!!\"\n\n\uC870\uD3ED\uB3C4 \uC774\uB7F0 \uC870\uD3ED\uC774 \uB530\uB85C \uC5C6\uB124",
