  "text" : "\"\uC633\uC9C0, \uC800\uAC70\uB77C\uBA74 \uB0B4\uAC00 \uB530\uBA39\uC744 \uC218 \uC788\uACA0\uB2E4.\"\n\n\uC5EC\uC6B0\uB294 \uD3EC\uB3C4\uB97C \uB530\uBA39\uAE30 \uC704\uD574 \uD798\uAECF \uB6F0\uC5B4 \uC62C\uB790\uC2B5\uB2C8\uB2E4. \uADF8\uB807\uC9C0\uB9CC \uBC88\uBC88\uC774 \uC785\uC5D0 \uB2FF\uC744 \uB4EF \uB9D0\uB4EF \uD3EC\uB3C4\uB294 \uB5A8\uC5B4\uC9C0\uC9C0 \uC54A\uC558\uC2B5\uB2C8\uB2E4.\n\n\"\uC544\uB2C8, \uC800 \uD3EC\uB3C4\uB294 \uC65C \uC774\uB807\uAC8C \uB192\uC774 \uB2EC\uB824\uC788\uB294 \uAC70\uC57C?! \uD765, \uC800\uAE4C\uC9D3 \uC2DC\uC5B4\uBE60\uC9C4 \uD3EC\uB3C4. \uD277!\"",
