  "text" : "\uCF54\uBBF8\uB514 \uC13C\uD2B8\uB7F4\uC758 \uB2E4\uB978 \uC1FC\uB4E4\uCC98\uB7FC, \u300A\uC0AC\uC6B0\uC2A4 \uD30C\uD06C\u300B\uB294 \uD2B9\uC815\uD55C \uB2E8\uC5B4\uB97C \uBE44\uD504\uC74C\uC73C\uB85C \uBC14\uAFC8\uC73C\uB85C\uC368 \uC758\uC678\uB85C \uC801\uC740 \uAC80\uC5F4\uC744 \uB2F9\uD588\uB2E4. \uADF8\uB7EC\uB098 \u300A\uC0AC\uC6B0\uC2A4 \uD30C\uD06C\u300B\uB3C4 \uBB34\uC81C\uD55C\uC73C\uB85C \uD5C8\uB77D \uBC1B\uC9C0 \uBABB\uD588\uB2E4. \u201CJared Has Aides\u201D \uC5D0\uD53C\uC18C\uB4DC\uB294 \uCF54\uBBF8\uB514 \uC13C\uD2B8\uB7F4\uC5D0\uC11C \uC7AC\uBC29\uC1A1\uB418\uC9C0 \uBABB\uD588\uB294\uB370,",
