  "text" : "\uCE74\uCE74\uC624\uC2A4\uD1A0\uB9AC\uB3C4 \uC628\uAC16 \uD604\uB780\uD55C \uC774\uBAA8\uD2F0\uCF58 \uC368\uB300\uBA74\uC11C \uAEC4\uB5A1\uB300\uB294 \uBCD1\uC2E0\uB4E4\uC774 \uB9CE\uC544\uC838\uC11C \uC9DC\uC99D\uB09C\uB2E4. \uB611\uAC19\uC740 \uBA58\uD2B8\uB97C \uB2E4\uB978\uB370\uC11C\uB3C4 \uC4F0\uACE0 \uC788\uACE0 \uB9C9 \u314B\u314B\u314B\u314B\u314B\u314B\u314B \uADFC\uB370 \uD398\uBD81\uACFC \uB2EC\uB9AC \uBA54\uC2E0\uC800 \uAE30\uB2A5\uC774 \uC5C6\uC5B4\uC11C, \uBA54\uC2E0\uC800\uB85C \uBED8\uC18C\uB9AC \uD558\uB294 \uB188\uB4E4\uC774 \uC5C6\uC5B4 \uADF8\uB098\uB9C8 \uB2E4\uD589\uC774\uB77C\uACE0 \u314B\u314B\u314B\u314B\u314B",
