  "in_reply_to_user_id" : 95255804,
  "text" : "\uADF8\uB9AC\uACE0 \uB9CC\uB0AC\uB294\uB370, \uC624\uD504\uC0C1\uB300\uAC00 \"\uB098\uC058\uC9C0 \uC54A\uC740\uB370? \uADC0\uC5EC\uC6B4\uB370?\" \uB77C\uBA70 \uB0B4 \uBA38\uB9AC\uB97C \uB9CC\uC9C0\uC791\uAC70\uB838\uB2E4. \uC641\uC2A4\uB97C \uBC14\uB978 \uB0B4 \uBA38\uB9AC\uAC00 \uBB49\uAC1C\uC9D0\uC744 \uB290\uB07C\uBA70 \uAE30\uBD84\uC774 \uB9E4\uC6B0 \uB354\uB7EC\uC6CC\uC84C\uACE0.. \uADF8\uB798\uC11C \uAC70\uC758 \uB9D0\uB3C4 \uC548\uD558\uACE0, \uC0C1\uB300\uBC29 \uCCD0\uB2E4\uBCF4\uC9C0\uB3C4 \uC54A\uB2E4\uAC00 \uADF8\uB0E5 \uC624\uD504 \uD30C\uD1A0\uB0B4\uACE0 \uC634 @seungow",
