  "text" : "\uBBF8\uC6A9\uC2E4\uC5D0\uC11C\uB3C4 \uC774\uAC74 \uC544\uB2C8\uB2E4 \uC2F6\uC5C8\uB294\uC9C0, \uC5B4\uC0C9\uD55C \uC6C3\uC74C\uC744 \uC9C0\uC73C\uBA70 \"\uC641\uC2A4 \uBC14\uB974\uBA74 \uAD1C\uCC2E\uACA0\uB294\uB370\uC694?\" \uB77C\uBA70 \uC641\uC2A4\uB97C \uBC1C\uB77C\uC92C\uB2E4. \uBB50.. \uBC1C\uB77C\uB3C4 \uD3ED\uB9DD\uC774\uB354\uAD6C\uB9CC -_- \uC5B4\uCA4C\uACA0\uC5B4.. \uBE59\uAD6C\uBA38\uB9AC\uB97C \uD55C \uCC44\uB85C \uC624\uD504\uB97C \uD558\uB7EC \uB098\uAC00\uBA74\uC11C \uCE74\uD1A1\uC73C\uB85C \uB0B4 \uBA38\uB9AC\uAC00 \uB9DD\uD588\uC74C\uC744 \uD1B5\uC9C0\uD588\uB2E4 @seungow",
