  "text" : "\uB0B4\uAC00 \uC624\uD504\uB97C \uB098\uAC00\uC11C \uC0C1\uB300\uAC00 \uB0B4 \uD0C0\uC785\uC774 \uC544\uB2C8\uB354\uB77C\uB3C4 \uB0B4\uC0C9 \uC548\uD558\uACE0 \uC798 \uB178\uB294 \uD3B8\uC778\uB370, \uD558\uB8E8\uB294 \uD2B8\uC704\uD130\uC5D0\uC11C \uB9CC\uB09C\uC9C0 \uBC18\uB098\uC808\uB9CC\uC5D0 \uC804\uACA9 \uC624\uD504\uB97C \uD588\uB2E4. \uADF8\uB9AC\uACE0 \uBA38\uB9AC\uAC00 \uB108\uBB34 \uAE38\uAE38\uB798 \uB098\uAC00\uB294 \uAE38\uC5D0 \uBBF8\uC6A9\uC2E4\uC5D0 \uB4E4\uB7EC\uC11C \uBA38\uB9AC\uB97C \uC798\uB790\uB294\uB370, \uC774\uAC8C \uADF8\uB0E5 \uD3ED\uB9DD- \uBC14\uBCF4\uBA38\uB9AC\uB97C \uB9CC\uB4E4\uC5B4\uB1A8\uB2E4.",
