  "text" : "\uC5EC\uD2BC, \uB300\uBD80\uBD84\uC758 \uB0A8\uC790\uB4E4\uC740 \uAD70\uB300 \uC774\uC57C\uAE30\uB9CC \uB098\uC624\uBA74 \uBC18\uCBE4 \uC774\uC131\uC744 \uC783\uACE0 \uB4E4\uC5B4\uAC00\uB294 \uAC83 \uAC19\uB2E4. \uC774\uC57C\uAE30 \uB4E3\uB2E4\uBCF4\uBA74 \uAE40\uC815\uC77C\uC774 \uC8FD\uC740 \uC774\uC720\uB294 \uB2E4\uB4E4 \uC790\uAE30\uAC00 \uD2B9\uC218\uC784\uBB34 \uC911\uC5D0 \uC8FD\uC5EC\uC11C \uADF8\uB7F0 \uAC83 \uAC19\uAE30\uB3C4 \uD558\uACE0. \uB09C \uC65C \uD0C0\uC778\uC758 \uAD8C\uB9AC\uB97C \uCE68\uD574\uD558\uBA74\uC11C\uAE4C\uC9C0 \uB300\uC6B0\uB97C \uC694\uAD6C\uD560 \uB300\uB2E8\uD55C \uAD70\uBCF5\uBB34\uB97C \uBABB\uD588\uB098",
