  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uAD70\uBBF8\uD544\uC790(\uCD9C\uC0B0\uD55C \uC5EC\uC131 \uC81C\uC678)\uB4E4\uC744 \uB300\uC0C1\uC73C\uB85C \uD55C \"\uAD6D\uBC29\uC9C0\uC6D0\uC138(\uAC00\uCE6D)\"\uB97C \uACFC\uC138\uD588\uC73C\uBA74 \uC88B\uACA0\uB2E4. \uAC1C\uC778\uB2F9 \uD55C\uB2EC\uC5D0 \uBA87\uBC31\uC6D0 \uAF34\uB85C\uB9CC \uACFC\uC138\uD574\uB3C4, \uADF8\uAC8C \uBAA8\uC774\uACE0 \uBAA8\uC774\uBA74 \uAF64 \uD070 \uB3C8\uC774 \uB420\uD14C\uACE0- \uC774 \uC7AC\uC6D0\uC73C\uB85C \uAD70\uD544\uC790 \uD559\uC790\uAE08 \uC9C0\uC6D0\uC774\uB098 \uC758\uB8CC\uC9C0\uC6D0 \uBC0F \uD604\uC5ED\uBCD1 \uAE09\uC5EC\uC758 \uD604\uC2E4\uD654",
