  "text" : "\uB2E8\uC21C \uAD70\uC804\uC5ED\uC790\uC640 \uC0C1\uC774\uAD70\uACBD \uBC0F \uC804\uBAB0\uAD70\uACBD\uC744 \uBE44\uAD50\uD558\uB294 \uACB0\uB840\uB97C \uBC94\uD55C \uB2F9\uC2E0\uC758 \uB9C8\uC778\uB4DC\uC5D0 \uAC74\uBC30- \uC800\uB294 \uB9D0\uC774\uC8E0, \uC0C1\uC774\uAD70\uACBD \uBC0F \uC804\uBAB0\uAD70\uACBD\uC5D0 \uB300\uD55C \uBCF4\uD6C8\uC744 \uB2F9\uC2E0\uC5D0\uAC8C\uB3C4 \uC918\uC57C \uD560 \uB9CC\uD07C \uB2F9\uC2E0\uC774 \uB300\uB2E8\uD55C \uAD70\uC0DD\uD65C\uC744 \uD588\uB2E4 \uBBFF\uC9C0 \uC54A\uC544\uC694. \uC2E0\uBCD1\uB54C \uC5B4\uB9AC\uBC84\uB9AC \uAE4C\uB2E4\uAC00 \uC801\uB2F9\uD788 \uC9EC\uC9C8\uD558\uACE0 \uB098\uC654\uACA0\uC9C0.",
