  "text" : "\uB098\uB3C4 \uAD70\uBCF5\uBB34\uB97C \uD588\uACE0, \uB0B4 \uC2DC\uAC04 \uB9CE\uC774 \uBE7C\uC558\uACBC\uACE0, \uB2E4\uCE58\uAE30\uB3C4 \uD558\uBA70 \uC774\uB7F0 \uC800\uB7F0 \uACE0\uC0DD\uC744 \uD588\uC9C0\uB9CC, \uADF8\uAC78 \uAC00\uC9C0\uACE0 \uC628\uAC16 \uC0DD\uC0C9\uC744 \uB2E4 \uB0B4\uBA74\uC11C \"\uC528\uBC1C \uAD70\uBCF5\uBB34\uAC00 \uB300\uB2E8\uD55C\uAC8C \uC544\uB2C8\uB77C\uB2C8! \uB0B4 2\uB144\uC744 \uC544\uBB34\uAC83\uB3C4 \uC544\uB2CC \uAC83\uC73C\uB85C \uB9CC\uB4E4\uC9C0 \uB9D0\uC544\uC918!!\" \uB77C\uACE0 \uD560 \uC815\uB3C4\uB85C \uBC14\uBCF4\uAC00 \uB418\uC11C \uB098\uC624\uC9C4 \uC54A\uC74C",
