  "text" : "\uC870\uAD6D\uC744 \uC704\uD574 \uBAB8\uBC14\uCCD0 \uAD6D\uBC29\uC758 \uC758\uBB34\uB97C \uB2E4 \uD55C \uC0AC\uC2E4\uC740 \uC874\uACBD\uBC1B\uC544 \uB9C8\uB545\uD558\uACE0, \uADF8\uB7EC\uD55C \uD5CC\uC2E0\uC5D0 \uB300\uD55C \uBCF4\uC0C1\uC740 \uD544\uC694\uD558\uB098- \uADF8\uB7EC\uD55C \uC758\uBB34\uC218\uD589\uC774 \uD0C0\uC778\uC758 \uAD8C\uB9AC\uB97C \uC2EC\uAC01\uD558\uAC8C \uCE68\uD574\uD558\uBA74\uC11C\uAE4C\uC9C0 \uBCF4\uC0C1\uD574\uC918\uC57C \uD560 \uC815\uB3C4\uB85C \uB300\uB2E8\uD55C \uACBD\uD5D8\uC774\uC5C8\uB098. \uC544\uB2C8\uC796\uC544? \uB2F9\uC2E0\uC774 \uC0C1\uC774\uAD70\uACBD \uBC0F \uC804\uBAB0\uAD70\uACBD\uB3C4 \uC544\uB2CC\uB370.",
