  "text" : "\uADF8\uB7AC\uB354\uB2C8 \uB098\uB984 \uBC18\uC751\uC774 \uB728\uAC81\uB354\uB77C. \uC804\uD6C4\uBB38\uB9E5 \uB2E4 \uB5BC\uC5B4\uBA39\uACE0 \"\uAD70\uBCF5\uBB34 \uAC00\uC9C0\uACE0 \uC0DD\uC0C9\uB0B4\uC9C0 \uB9D0\uC544\uB77C. \uAD70\uBCF5\uBB34\uAC00 \uADF8\uB807\uAC8C \uB300\uB2E8\uD55C \uAC83\uC774\uC5C8\uB354\uB0D0?\" \uB77C\uB294 \uD2B8\uC717\uB9CC \uC2E0\uB098\uAC8C \uB9AC\uD2B8\uC717 \uB418\uC5C8\uACE0, \uADF8\uB0E5 \uB9AC\uD2B8\uC717\uB9CC \uD55C \uC5EC\uC131\uC720\uC800\uB4E4\uACFC\uB294 \uB2EC\uB9AC \uC77C\uBD80\uB0A8\uC131\uD2B8\uC704\uD130\uB4E4\uC740 \uC774\uB97C \uB9AC\uD2B8\uC717 \uD55C \uB4A4 @seungow",
