  "text" : "\uB0B4\uAC00 \uBB50 \uBC25\uBA39\uACE0 \uD560 \uC9D3\uC774 \uC5C6\uC5B4\uC11C X\uB3C4 \uBAA8\uB974\uACE0 \"\uC81C\uB300\uAD70\uC778\uAC00\uC0B0\uC810\uC81C\uB3C4\uB294 \uB2E8\uC21C\uC6B0\uB300\uC870\uCE58\uC77C \uBFD0\" \uC774\uB77C\uACE0 \uD588\uC744 \uAC83 \uAC19\uB098.. \uADF8\uB3D9\uC548 \uC5F0\uAD6C\uD574\uC628 \uBC14\uAC00 \uC788\uACE0, \uBC95\uB9AC\uC0C1\uC73C\uB85C\uB098 \uC815\uCC45\uC0C1\uC73C\uB85C\uB098 \uB2E8\uC21C\uC6B0\uB300\uC870\uCE58\uC131\uC5D0 \uB300\uD55C \uD655\uC2E0\uC774 \uC788\uAE30 \uB54C\uBB38\uC774\uACA0\uC9C0. \uB098\uB3C4 \uC5F0\uAD6C\uC6D0\uC73C\uB85C\uC11C\uC758 \uC9EC\uC774 \uC788\uB294\uB370 -_-",
