  "text" : "\uAC11\uC790\uAE30 \uD6C8\uB828\uC18C\uC5D0\uC11C \uC788\uC5C8\uB358 \uC77C\uC774 \uC0DD\uAC01\uB09C\uB2E4. \uC8FC\uB9D0 \uC885\uAD50\uD65C\uB3D9\uC2DC\uAC04\uC5D0\uB294 \uB17C\uC0B0\uD6C8\uB828\uC18C \uB0B4\uC758 \uB2E4\uC591\uD55C \uD6C8\uB828\uBCD1\uB4E4\uC774 \uBAA8\uC774\uAC8C \uB41C\uB2E4. \uADFC\uB370 \uD604\uC5ED\uBCD1\uC73C\uB85C \uC9D5\uC9D1\uB41C \uD6C8\uB828\uBCD1\uB4E4\uC774 \uACF5\uC775\uADFC\uBB34\uC694\uC6D0\uC73C\uB85C \uC9D5\uC9D1\uB41C \uD6C8\uB828\uBCD1\uB4E4\uC744 \uBCF4\uBA74\uC11C \uBE44\uC6C3\uACE0, \uC2EC\uC9C0\uC5B4\uB294 \uC695\uC124\uAE4C\uC9C0 \uD558\uB294\uAC78 \uBCF4\uBA74\uC11C \uC774\uB798\uC800\uB798 \uB9C8\uC74C\uC774 \uBD88\uCF8C\uD588\uC74C",
