  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uAD70\uBBF8\uD544 \uB0A8\uC131\uACFC \uBE44\uCD9C\uC0B0 \uC5EC\uC131\uC744 \uB300\uC0C1\uC73C\uB85C \uAD6D\uBC29\uC9C0\uC6D0\uBE44(\uAC00\uCE6D)\uB4F1\uC758 \uC138\uAE08\uC744 \uD569\uB9AC\uC801\uC778 \uBC94\uC704 \uB0B4\uC5D0\uC11C \uCC28\uBCC4\uC9D5\uC218\uD558\uB294 \uAC83\uB3C4 \uD55C \uBC29\uD3B8\uC774 \uB420 \uAC83\uC774\uB77C\uACE0 \uC0DD\uAC01\uD55C\uB2E4. \uAC1C\uAC1C\uC778\uC5D0\uAC8C\uB294 \uB2E8 \uBA87\uBC31\uC6D0\uC774\uC9C0\uB9CC, \uADF8 \uB3C8\uC774 \uBAA8\uC778\uB2E4\uBA74 \uAD70\uBCF5\uBB34\uC790\uC5D0\uAC8C\uB294 \uD070 \uB3C4\uC6C0\uC774 \uB420\uD14C\uB2C8\uAE4C @seungow",
