  "text" : "\uC5EC\uD0DC\uAC00\uC9C0 \uD22D\uD558\uBA74 \uB9C8\uB140\uC0AC\uB0E5\uC5D0 \uC55E\uC7A5\uC11C\uB358 \uBD84\uB4E4\uC774, \uC9C0\uAE08\uC740 \uB9C8\uB140\uC0AC\uB0E5\uC744 \uBE44\uD310\uD558\uACE0 \uACC4\uC2E0\uB2E4. \uD765\uBBF8\uB85C\uC6B4 \uC77C\uC774\uC57C... \uC5EC\uD2BC, \uC6B0\uB9AC\uBBFC\uC871\uB07C\uB9AC \uD574\uD0B9\uC0AC\uAC74\uC740 \uC774\uB798\uC800\uB798 \uC5C9\uB6B1\uD558\uAC8C \uC7AC\uBBF8\uC788\uB294 \uC77C\uB4E4\uB9CC \uAC00\uC838\uC624\uB294\uAD6C\uB098. \uB0B4\uAC00 \uD574\uCEE4\uB77C\uBA74 \uD55C\uBBFC\uC871\uB4E4\uC744 \uC0C1\uB300\uB85C \uD574\uD0B9\uD558\uAE30 \uC2EB\uACA0\uC5B4.. \uBB58 \uD574\uB3C4 \uBC14\uBCF4\uB428-",
