  "text" : "\uB2E4\uAC19\uC774 \uC911\uAD6D\uC9D1 \uAC14\uC744 \uB54C, \uB2E8\uBB34\uC9C0 \uC9D1\uC5B4\uBA39\uB4EF\uC774 \uD0D5\uC218\uC721 \uC9D1\uC5B4\uBA39\uC9C0\uC880 \uB9D9\uC2DC\uB2E4. \uD0D5\uC218\uC721\uC740 \uC801\uC5B4\uB3C4 \uC790\uAE30 \uC74C\uC2DD\uACFC 3:1\uC758 \uBE44\uC728\uB85C \uC9D1\uC5B4\uBA39\uB294\uAC8C \uB9E4\uB108 \uC544\uB2CC\uAC00\uC5EC? \uC774\uC2DC\uBC8C, \uD0D5\uC218\uC721\uBD80\uD130 \uC870\uC9C0\uACE0\uB098\uC11C \uC9C0\uAEBC \uBA39\uAE30 \uC2DC\uC791\uD558\uBA74 \uC5B4\uCA4C\uC790\uB294\uAC70\uC57C.. \uBD88\uC744\uAE4C\uBD10 \uC77C\uBD80\uB7EC \uBCF6\uC74C\uBC25 \uC2DC\uCF30\uC744\uAEBC\uC57C, \uBD84\uBA85\uD574.",
