  "text" : "\"\uB108\uAC00 \uD2B9\uC815 \uC804\uBB38\uBD84\uC57C\uC5D0 \uB300\uD574 \uAE4C\uB824\uBA74, \uB108\uB3C4 \uADF8 \uBD84\uC57C\uC5D0 \uB300\uD574 \uC804\uBB38\uAC00\uAC00 \uB418\uC5B4\uC57C \uD55C\uB2E4\" \uB77C\uACE0\uAE4C\uC9C0 \uD558\uC9C4 \uC54A\uACA0\uB2E4. \uD558\uC9C0\uB9CC \uC801\uC5B4\uB3C4 \uC790\uAE30\uAC00 \uAE4C\uB824\uACE0 \uD558\uB294 \uAC83\uC5D0 \uB300\uD55C \uCD5C\uC18C\uD55C\uC758 \uC774\uD574\uB294 \uD574\uBCF4\uB824\uB294 \uB178\uB825 \uC815\uB3C4\uB294 \uD544\uC694\uD558\uC9C0 \uC54A\uC744\uAE4C? \uADF8 \uB300\uC0C1\uC774 \uBC95\uC774\uB77C\uBA74 \uC870\uBB38\uC744 \uC77D\uC5B4\uB3C4 \uBCF4\uACE0 \uC880..",
