  "text" : "\uCC38\uACE0\uB85C \uCE74\uD22C\uC0AC \uC804\uC5ED\uC790\uC758 \uC608\uBE44\uAD70 \uC18C\uC18D\uC740 \uB300\uD55C\uBBFC\uAD6D \uC721\uAD70 \uBCD1\uC7A5\uC774\uBA70, \uC804\uC2DC \uB3D9\uC6D0\uC2DC\uC5D0\uB3C4 '\uC608\uBE44\uC5ED \uBCD1\uC7A5 \uCE74\uD22C\uC0AC'\uB85C \uB3D9\uC6D0\uC774 \uB418\uACE0, \uCD5C\uC885 \uC804\uC5ED \uB2F9\uC2DC \uBD80\uB300\uC5D0\uC11C \uBCF4\uC9C1\uB418\uC5C8\uB358 \uC8FC\uD2B9\uAE30\uBC88\uD638\uB97C \uBD80\uC5EC\uBC1B\uAC8C \uB429\uB2C8\uB2E4. \uC800\uB294 \uC804\uC7C1\uB098\uBA74 \uB300\uAD6C\u00B7\uBD80\uC0B0 \uC77C\uB300\uB85C \uBE60\uC838\uC11C \uACF5\uBCF4\uC5C5\uBB34\uB97C \uB9E1\uAC8C \uB41C\uB2E4\uACE0 \uB4E4\uC74C",
