  "text" : "\uB2F9\uC7A5 \uC77C\uBCF8 \uC6D0\uC804\uC0AC\uACE0 \uB54C\uB9CC \uD574\uB3C4 \uC8FC\uC77C\uBBF8\uAD70 \uAC00\uC871\uB4E4\uC758 \uC77C\uBD80\uB97C NEO\uC5D0 \uC758\uD574 \uC624\uC0B0\uACFC \uD3C9\uD0DD\uC758 \uBBF8\uAD70\uAE30\uC9C0\uB85C \uC62E\uACBC\uC5C8\uB294\uB370, \uBBF8\uAD6D\uC774 \uBD81\uD55C\uACFC\uC758 \uC804\uC7C1\uC774 \uC6B0\uB824\uB418\uB294 \uC9C0\uC5ED\uC5D0 \uC790\uAD6D\uBBFC\uB4E4\uC744 \uADF8\uB0E5 \uB0B4\uBC84\uB824 \uB458\uAE4C\uBD10.. \uC8FC\uBCC0\uC758 \uC678\uAD6D\uC778\uB4E4\uC774 \uB300\uADDC\uBAA8\uB85C \uC18C\uAC1C\uB418\uAE30 \uC2DC\uC791\uD558\uBA74, \uADF8\uB54C\uAC00 \uCAC4\uC544\uC57C \uB420 \uD0C0\uC774\uBC0D",
