  "text" : "NEO(Noncombatant Evacuation Operation; \uBE44\uC804\uD22C\uC6D0 \uC18C\uAC1C \uC791\uC804)\uB77C\uACE0 \uD574\uC11C- \uC790\uAD6D\uBBFC\uB4E4\uC744 \uC804\uC7C1\uC774\uB098 \uD14C\uB7EC \uB4F1\uC758 \uC704\uD5D8\uC9C0\uC5ED\uC5D0\uC11C \uCCA0\uC218\uC2DC\uD0A4\uB294 \uC791\uC804\uC774 \uC788\uACE0, \uC8FC\uD55C\uBBF8\uAD70\uC5D0\uC11C\uB3C4 \uC774 \uC791\uC804\uC5D0 \uB530\uB77C \uD6C8\uB828\uC744 \uD569\uB2C8\uB2E4. \uC9C4\uC9DC \uC804\uC7C1 \uB0A0 \uAC83 \uAC19\uC73C\uBA74 \uC2DC\uD589\uD588\uC9C0\uC694",
