  "text" : "\uD0C0\uC784\uB77C\uC778\uC5D0 \uC804\uC7C1\uB098\uB0D0\uB294 \uC774\uC57C\uAE30\uBC16\uC5D0 \uC548\uBCF4\uC778\uB2E4. \uC815\uB9D0\uB85C \uC804\uC7C1\uC774 \uB0A0 \uAC83 \uAC19\uC740 \uBD84\uC704\uAE30\uAC00 \uB418\uBA74 \uB9D0\uC774\uC8E0, \uAC01\uAD6D \uB300\uC0AC\uAD00\uB4E4\uC774 \uB300\uD55C\uBBFC\uAD6D \uB0B4\uC5D0 \uAC70\uC8FC\uC911\uC778 \uC790\uAD6D\uBBFC\uB4E4\uC744 \uBCF8\uAD6D\uC774\uB098 \uAC00\uAE4C\uC6B4 \uC77C\uBCF8 \uB4F1\uC9C0\uB85C \uC18C\uAC1C(\u758F\u958B, \uB300\uD53C\uC640 \uBE44\uC2B7\uD55C \uB73B)\uC2DC\uD0B5\uB2C8\uB2E4. \uB300\uD55C\uBBFC\uAD6D\uC740 \uC5EC\uD589\uC790\uC81C\uAD6D\uC73C\uB85C \uC9C0\uC815\uB420\uD14C\uAD6C\uC694.",
