  "text" : "\uAC1C\uC778\uC801\uC73C\uB85C\uB294 \uC704\uD5CC\uC131 \uC2DC\uBE44\uC5D0\uC11C \uBC97\uC5B4\uB0A0 \uC218 \uC5C6\uC744 \uAD70\uAC00\uC0B0\uC810\uC81C\uB3C4\uC5D0 \uBAA9\uB9E4\uB294 \uAC83 \uBCF4\uB2E4\uB294.. \uCC28\uB77C\uB9AC \uAD70\uBCF5\uBB34\uAE30\uAC04\uB9CC\uD07C\uC744 \uD638\uBD09\uC73C\uB85C \uC778\uC815\uD574 \uC8FC\uB294 \uC81C\uB3C4\uB098, \uAD70\uBCF5\uBB34\uAE30\uAC04\uC758 \uD559\uC790\uAE08\uB300\uCD9C\uC774\uC790\uB97C \uAD6D\uAC00\uC5D0\uC11C \uC9C0\uC6D0\uD574 \uC900\uB2E4\uB358\uAC00, \uC544\uB2C8\uBA74 \uAD6D\uAC00\uAC00 \uD559\uC790\uAE08 \uC790\uCCB4\uB97C \uC9C0\uC6D0\uD574 \uC900\uB2E4\uB358\uAC00 @seungow",
