  "text" : "\uC0AC\uC2E4\uC0C1 \uC18C\uC218\uC810\uB300\uC758 \uC810\uC218\uCC28\uC774\uB85C \uD569\uACA9\uC758 \uB2F9\uB77D\uC774 \uAC08\uB9AC\uB294 \uCDE8\uC5C5\uC2DC\uC7A5\uC5D0\uC11C, \uAD70\uAC00\uC0B0\uC810\uC758 \uBE44\uC728\uC744 \uC544\uBB34\uB9AC \uC870\uC815\uD574\uBD24\uC790 \uAD70\uAC00\uC0B0\uC810\uC774 \uB2F9\uB77D\uC5D0 \uBBF8\uCE58\uB294 \uC601\uD5A5\uC740 \uC0AC\uC2E4\uC0C1 \uC808\uB300\uC801\uC774\uB77C\uACE0 \uBCF4\uC785\uB2C8\uB2E4. \uADF8\uB7EC\uBA74 \uB610\uB2E4\uC2DC \uC704\uD5CC\uC2DC\uBE44\uC5D0 \uD718\uB9D0\uB9B4 \uC218\uBC16\uC5D0 \uC5C6\uACA0\uC9C0\uC694. @seungow",
