  "text" : "\uC774\uC0C1\uC774 \uD5CC\uBC95\uC7AC\uD310\uC18C\uAC00 \uAD70\uAC00\uC0B0\uC810\uC81C\uB3C4\uC5D0 \uB300\uD574 \uB0B4\uB9B0 \uD310\uB2E8\uC785\uB2C8\uB2E4. \uC5C4\uBC00\uD788 \uB9D0\uD558\uC790\uBA74 \uAD70\uAC00\uC0B0\uC810\uC81C\uB3C4 \uC790\uCCB4\uB294 \uC704\uD5CC\uC774 \uC544\uB2C8\uC9C0\uB9CC, \uD569\uACA9\uC5EC\uBD80\uC5D0 \uC808\uB300\uC801 \uC601\uD5A5\uC744 \uB07C\uCE58\uB294 \uB192\uC740 \uAC00\uC0B0\uC810\uC758 \uBE44\uC728(3~5%)\uC774 \uBD80\uB2F9\uD558\uC5EC \uC704\uD5CC\uC774\uB77C\uACE0 \uD310\uB2E8\uD588\uC8E0. \uADF8\uB798\uC11C \uC774\uBC88\uC5D0 \uADF8 \uBE44\uC728\uC744 \uC870\uC815\uD558\uACA0\uB2E4\uACE0 \uD558\uB294\uAC74\uB370",
