  "text" : "\uC81C\uB300\uAD70\uC778\uC740 \uACC4\uC18D \uAC00\uC0B0\uC810\uD61C\uD0DD\uC744 \uBC1B\uC744 \uC218 \uC788\uB2E4. \uC774\uB294 \uD55C \uC0AC\uB78C\uC758 \uC81C\uB300\uAD70\uC778\uC744 \uC704\uD558\uC5EC \uBA87 \uC0AC\uB78C\uC758 \uBE44\uC81C\uB300\uAD70\uC778\uC758 \uAE30\uD68C\uAC00 \uBC15\uD0C8\uB2F9\uD560 \uC218 \uC788\uC74C\uC744 \uC758\uBBF8\uD558\uB294 \uAC83\uC774\uB2E4. \uC774\uCC98\uB7FC \uAC00\uC0B0\uC810\uC81C\uB3C4\uB294 \uC2B9\uC9C4, \uBD09\uAE09 \uB4F1 \uACF5\uC9C1\uB0B4\uBD80\uC5D0\uC11C\uC758 \uCC28\uBCC4\uC774 \uC544\uB2C8\uB77C @seungow",
