  "text" : "\uC5C4\uBC00\uD788 \uB9D0\uD558\uC790\uBA74 \uB8E9\uC148\uBD80\uB974\uD06C\uB294 '\uACF5\uAD6D'\uC774 \uC544\uB2CC '\uB300\uACF5\uAD6D' \uC785\uB2C8\uB2E4. \uB8E9\uC148\uBD80\uB974\uD06C\uC758 \uAD70\uC8FC\uB294 \uACF5\uC791\uC774 \uC544\uB2CC '\uB300\uACF5'\uC774\uAE30 \uB54C\uBB38\uC774\uC8E0. (\uB300\uACF5\uC774\uB780 \uACF5\uC791\uBCF4\uB2E4 \uC0C1\uC704\uC5D0 \uC704\uCE58\uD55C \uC791\uC704\uC785\uB2C8\uB2E4) \uD604\uC7AC \uB8E9\uC148\uBD80\uB974\uD06C\uC758 \uAD70\uC8FC\uB294 '\uC559\uB9AC \uB4DC \uB8E9\uC148\uBD80\uB974\uD06C' \uB300\uACF5\uC785\uB2C8\uB2E4. @seungow",
